import React from 'react';
import { Container, TextField, Button } from '@mui/material';

const LoginScreen = () => {
  return (
    <Container maxWidth="sm">
      <div style={{ backgroundColor: '#1976D2', padding: '20px', borderRadius: '8px', color: 'white' }}>
        <h2>Login</h2>
        <TextField label="Email" variant="outlined" fullWidth />
        <TextField label="Senha" type="password" variant="outlined" fullWidth style={{ marginTop: '10px' }} />
        <Button variant="contained" color="primary" fullWidth style={{ marginTop: '20px' }}>
          Login
        </Button>
      </div>
    </Container>
  );
}

export default LoginScreen;
